import React, {Component} from "react";
import Costumer from '../views/Costumer';


class CostumerList extends Component{

    render(){
        return(
            <div className="data">
                <table className="ui celled table">
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Name</th>
                            <th>Email</th>
                            <th>Action</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>1</td>
                            <td>John Doe</td>
                            <td>john@gmail.com</td>
                            <td>
                                <button className="mini ui blue button">Edit</button>
                                <button className="mini ui red button">Delete</button>
                            </td>
                        </tr>
                    </tbody>
                </table>
            </div>
            
        );
    }
}
export default CostumerList;
